import React from "react";
import "../CSS/Tweet.css";

function Tweet({content, firstName, lastName}) {
    return <div className="Tweet">
        <div className="profil">
            <p>{firstName}</p>
            <p>{lastName}</p>
        </div>
        <p className="content">{content}</p>
    </div>;
}
export default Tweet;
